import React from "react";

function OneInner() {
  return (
    <div className="t-one-inner">
      <h2 className="t-header-one-inner">Vote</h2> <br />
      <p className="t-text-one-inner">
        With our Vote product your customers can vote for there favourite
        product with feedback. You'll have unprecedented knowledge about your
        customers demands.
      </p>
    </div>
  );
}

export default OneInner;
